import { createBrowserRouter, createRoutesFromElements, Route, RouterProvider } from "react-router-dom";
import HomePage from "./pages/Home";
import ProductPage from "./pages/Product";
import RootLayout from "./pages/Root";

//Define routes to support in this app, takes an [] of route definition objects
const router1 = createBrowserRouter([{
path: '/',
element: <RootLayout />,
//Outlet renders them
children: [
  //path for which route should be active, and element means the jsx code for given path
  { path: '/', element: <HomePage />},
  { path: '/products', element: <ProductPage />}
]
}])

const routeDefinitions = createRoutesFromElements(
<Route path="/" element={<RootLayout />} >
  <Route path="/" element={<HomePage />}/>
  <Route path="/products" element={<ProductPage />}/>
</Route>
)

const router2 = createBrowserRouter(routeDefinitions)

function App() {
  return <RouterProvider router={router1} />;
}

export default App;
